const Header = () => {
  return (
    <header style={styles.header}>
      <div style={styles.logo}>Funny Mind</div>
      <nav>
        <a href="#">Sobre Nosotros</a>
        <a href="#">Contactenos</a>
      </nav>
    </header>
  );
}
  const styles = {
    header: {
      display: 'flex',
      justifyContent: 'space-between',
      alingItems: 'center',
      backgroundColor: '#20B2AA',
      color: '#fff',
      padding: '1rem 2rem'
    },
    logo: {
      fontSize: '1.5rem',
      fontWeight: 'bold'
    },
    nav: {
      display: 'flex',
      gap: '1.5rem'
    },
    link: {
      color: '#fff',
      textDecoration: 'none',
      fontSize: '1rem'
    }
  };

  export default Header;
